import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import Navbar from './components/Navbar';
import NewWishForm from './components/NewWishForm';
import './App.css';

const App = () => {
  return (
    <Router>
      <div className="app">
        <Navbar />
        <Switch>
          <Route path="/new-wish" component={NewWishForm} />
          {/* Añade más rutas aquí según sea necesario */}
        </Switch>
      </div>
    </Router>
  );
};

export default App;
